import React, { Component } from 'react'
import { Container, Row, Col } from 'react-bootstrap';
import './master.css'

export default class Div1 extends Component {
    render() {
        return (
            <div>
                <Container>
                    <Row>
                        <Col sm={9} md={8}>
                            <div>Item 2</div>
                        </Col>
                        <Col sm={3} md={4}>
                            <div>Item 3</div>
                        </Col>
                    </Row>
                </Container>
            </div>
        )
    }
}
